__NUXT_JSONP__("/drugs/Denibulin", (function(a){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"284019-34-7",chebiId:"",chemicalFormula:"C18H19N5O3S",definition:"A small molecular vascular disrupting agent (VDA), with potential antimitotic and antineoplastic activities. Denibulin selectively targets and reversibly binds to the colchicine-binding site on tubulin and inhibits microtubule assembly. This results in the disruption of the cytoskeleton of tumor endothelial cells, ultimately leading to cell cycle arrest, blockage of cell division and apoptosis. This causes inadequate blood flow to the tumor and eventually leads to a decrease in tumor cell proliferation.",fdaUniiCode:"K7037M241U",identifier:"C77065",preferredName:a,semanticType:"Pharmacologic Substance",subclassOf:["C67421"],synonyms:["DENIBULIN",a]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FDenibulin",extension:".json",createdAt:"2021-10-30T13:44:45.743Z",updatedAt:"2021-10-30T13:44:45.753Z"}}],fetch:{},mutations:void 0}}("Denibulin")));